import React from "react";
import { FaArrowCircleDown } from "react-icons/fa";

const RecentOrdersCard = ({
  id,
  title,
  subTitle,
  number,
  quantity,
  btn,
  date,
}) => {
  return (
    <div className="flex bg-white border py-5">
      <p>{id}</p>
      <p>{title}</p>
      <p>{number}</p>
      <p>{subTitle}</p>
      <p>{quantity}</p>
      <p>{date}</p>
      <button>
        {btn} <span>{<FaArrowCircleDown />}</span>
      </button>
    </div>
  );
};

export default RecentOrdersCard;
